// Import Libraries
import React, { useState } from "react";
import Switch from "react-switch";

const CaptionDisplay = (props) => {
  const [checked, setChecked] = useState(false);

  const onClickHandler = () => {
    setChecked(!checked);
  };

  return (
    <div class="flex flex-col w-40 h-64 bg-transparent rounded-3xl justify-items-center items-center text-black text-center ">
      <div class="h-1/4">
        <text>Captions Exist?</text>
        <label>
          <span>Switch with default style</span>
          <Switch onChange={onClickHandler} checked={checked} />
        </label>
      </div>
      <div class="h-3/4 bg-green-400 rounded-3xl rounded-t-none border-2 border-custom-light-blue">
        <text>Submit for Processing</text>
      </div>
    </div>
  );
};

export default CaptionDisplay;
